//创建[外壳]组件App

//{}并非解构赋值，而是导入单独暴露的属性！！！等价于const { Component } = React  
import React, { Component } from 'react'

export class App extends Component {
    render() {
        return (
            <div>
                <h2>Hello World</h2>
            </div>
        )
    }
}

